# 결과를 저장할 파일 이름
output_file = "outputTitleContent.json"

# 결과를 저장할 리스트 초기화
results = []

# 각 URL에 대해 처리
for url in urls:
    # HTTP GET 요청을 보냄
    response = requests.get(url)

    # 요청이 성공한 경우
    if response.status_code == 200:
        # BeautifulSoup 객체 생성
        soup = BeautifulSoup(response.text, 'html.parser')

        # 제목 추출
        title_tag = soup.find('h3', class_='md_m_tit')
        if title_tag:
            title = title_tag.text.strip()
        else:
            title = "제목을 찾을 수 없음"

        # 본문 추출
        content_div = soup.find('div', class_='single_cont')
        if content_div:
            # 본문 내용 추출
            paragraphs = content_div.find_all('p')
            content = ""
            for paragraph in paragraphs:
                # 이미지 태그가 있으면 이미지 설명을 추출하여 추가
                img_tag = paragraph.find('img')
                if img_tag:
                    img_description = img_tag.get('alt', 'No description available')
                    content += f"{img_description}\n"
                else:
                    content += f"{paragraph.text}\n"
        else:
            content = "본문을 찾을 수 없음"

        # 결과를 리스트에 추가
        results.append({'url': url, 'title': title, 'content': content})

    else:
        # 요청이 실패한 경우
        results.append({'url': url, 'title': "Failed to retrieve the page", 'content': ""})

# 결과를 JSON 파일로 저장
with open(output_file, "w", encoding="utf-8") as file:
    json.dump(results, file, ensure_ascii=False, indent=4)